ves to a new house, Woody and Buzz must escape the clutches of maladjusted neighbor Sid Phillips (Erik von Detten) and reunite with their boy.','https://m.media-amazon.com/images/M/MV5BMDU2ZWJlMjktMTRhMy00ZTA5LWEzNDgtYmNmZTEwZTViZWJkXkEyXkFqcGdeQXVyNDQ2OTk4MzI@._V1_QL75_UX380_CR0,2,380,562_.jpg','https://www.youtube.com/watch?v=v-PjgYDrg70&pp=ygURdG95IHN0b3J5IHRyYWlsZXI%3D','2024-09-05 21:30:00',NULL),(44,'Toy Story 3',103,'2010-06-29 00:00:00','English','With their beloved Andy preparing to leave for college, Woody (Tom Hanks), Buzz Lightyear (Tim Allen), Jessie (Joan Cusack), and the rest of the toys find themselves headed for the attic but mistakenly wind up on the curb with the trash. Woody\'s quick thinking saves the gang, but all but Woody end up being donated to a day-care center. Unfortunately, the uncontrollable kids do not play nice, so Woody and the gang make plans for a great escape.','https://m.media-amazon.com/images/M/MV5BMTgxOTY4Mjc0MF5BMl5BanBnXkFtZTcwNTA4MDQyMw@@._V1_QL75_UY562_CR9,0,380,562_.jpg','https://www.youtube.com/watch?v=JcpWXaA2qeg&pp=ygUTdG95IHN0b3J5IDMgdHJhaWxlcg%3D%3D','2024-09-05 21:30:00',NULL),(45,'Up',96,'2009-07-23 00:00:00','English','Carl Fredricksen, a 78-year-old balloon salesman, is about to fulfill a lifelong dream. Tying thousands of balloons to his house, he flies away to the South American wilderness. But curmudgeonly Carl\'s worst nightmare comes true when he discovers a little boy named Russell is a stowaway aboard the balloon-powered house. A Pixar animation.','https://m.media-amazon.com/images/M/MV5BYjBkM2RjMzItM2M3Ni00N2NjLWE3NzMtMGY4MzE4MDAzMTRiXkEyXkFqcGdeQXVyNDUzOTQ5MjY@._V1_QL75_UX380_CR0,1,380,562_.jpg','https://www.youtube.com/watch?v=HWEW_qTLSEE&pp=ygUKdXAgdHJhaWxlcg%3D%3D','2024-09-05 21:30:00',NULL),(46,'Your Name.',106,'2017-04-07 00:00:00','English','Two teenagers share a profound, magical connection upon discovering they are swapping bodies. Things manage to become even more complicated when the boy and girl decide to meet in person.','https://m.media-amazon.com/images/M/MV5BODRmZDVmNzUtZDA4ZC00NjhkLWI2M2UtN2M0ZDIzNDcxYThjL2ltYWdlXkEyXkFqcGdeQXVyNTk0MzMzODA@._V1_QL75_UX380_CR0,0,380,562_.jpg','https://www.youtube.com/watch?v=xU47nhruN-Q&pp=ygUReW91ciBuYW1lIHRyYWlsZXI%3D','2024-09-05 21:30:00',NULL),(47,'3 Idiots',170,'2009-12-25 00:00:00','English','In college, Farhan and Raju form a great bond with Rancho due to his positive and refreshing outlook to life. Years later, a bet gives them a chance to look for their long-lost friend whose existence seems rather elusive.','https://m.media-amazon.com/images/M/MV5BNTkyOGVjMGEtNmQzZi00NzFlLTlhOWQtODYyMDc2ZGJmYzFhXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_QL75_UY562_CR5,0,380,562_.jpg','https://www.youtube.com/watch?v=xvszmNXdM4w&pp=ygUQMyBpZGlvdHMgdHJhaWxlcg%3D%3D','2024-09-05 21:30:00',NULL),(48,'Star Wars: Episode VI - Return of the Jedi',131,'1983-05-25 00:00:00','English','Luke Skywalker (Mark Hamill) battles horrible Jabba the Hut and cruel Darth Vader to save his comrades in the Rebel Alliance and triumph over the Galactic Empire. Han Solo (Harrison Ford) and Princess Leia (Carrie Fisher) reaffirm their love and team with Chewbacca, Lando Calrissian (Billy Dee Williams), the Ewoks and the androids C-3PO and R2-D2 to aid in the disruption of the Dark Side and the defeat of the evil emperor.','https://m.media-amazon.com/images/M/MV5BOWZlMjFiYzgtMTUzNC00Y2IzLTk1NTMtZmNhMTczNTk0ODk1XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_QL75_UX380_CR0,13,380,562_.jpg','https://www.youtube.com/watch?v=7L8p7_SLzvU&pp=ygUacmV0dXJuIG9mIHRoZSBqZWRpIHRyYWlsZXI%3D','2024-09-05 21:30:00',NULL),(49,'2001: A Space Odyssey',149,'1968-05-12 00:00:00','English','An imposing black structure provides a connection between the past and the future in this enigmatic adaptation of a short story by revered sci-fi author Arthur C. Clarke. When Dr. Dave Bowman (Keir Dullea) and other astronauts are sent on a mysterious mission, their ship\'s computer system, HAL, begins to display increasingly strange behavior, leading up to a tense showdown between man and machine that results in a mind-bending trek through space and time.','https://m.media-amazon.com/images/M/MV5BMmNlYzRiNDctZWNhMi00MzI4LThkZTctMTUzMmZkMmFmNThmXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_QL75_UX380_CR0,0,380,562_.jpg','https://www.youtube.com/watch?v=oR_e9y-bka0&pp=ygUcMjAwMSBhIHNwYWNlIG9keXNzZXkgdHJhaWxlcg%3D%3D','2024-09-05 21:30:00',NULL),(50,'Oppenheimer',180,'2023-07-21 00:00:00','English','During World War II, Lt. Gen. Leslie Groves Jr. appoints physicist J. Robert Oppenheimer to work on the top-secret Manhattan Project. Oppenheimer and a team of scientists spend years developing and designing the atomic bomb. Their work comes to fruition on July 16, 1945, as they witness the world\'s first nuclear explosion, forever changing the course of history.','https://m.media-amazon.com/images/M/MV5BMDBmYTZjNjUtN2M1MS00MTQ2LTk2ODgtNzc2M2QyZGE5NTVjXkEyXkFqcGdeQXVyNzAwMjU2MTY@._V1_QL75_UX380_CR0,0,380,562_.jpg','https://www.youtube.com/watch?v=uYPbbksJxIg&pp=ygUTb3BwZW5oZWltZXIgdHJhaWxlcg%3D%3D','2024-09-05 21:30:00',NULL),(51,'Scarface',170,'1983-12-09 00:00:00','English','After getting a green card in exchange for assassinating a Cuban government official, Tony Montana (Al Pacino) stakes a claim on the drug trade in Miami. Viciously murdering anyone who stands in his way, Tony eventually becomes the biggest drug lord in the state, controlling nearly all the cocaine that comes through Miami. But increased pressure from the police, wars with Colombian drug cartels and his own drug-fueled paranoia serve to fuel the flames of his eventual downfall.','https://m.media-amazon.com/images/M/MV5BNjdjNGQ4NDEtNTEwYS00MTgxLTliYzQtYzE2ZDRiZjFhZmNlXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_QL75_UX380_CR0,4,380,562_.jpg','https://www.youtube.com/watch?v=7pQQHnqBa2E&pp=ygUQc2NhcmZhY2UgdHJhaWxlcg%3D%3D','2024-09-05 21:30:00',NULL),(52,'To Kill a Mockingbird',129,'1963-03-16 00:00:00','English','Atticus Finch, a widowed lawyer in Depression-era Alabama, defends a Black man against an undeserved rape charge, and tries to educate his young children against prejudice.','https://m.media-amazon.com/images/M/MV5BNmVmYzcwNzMtMWM1NS00MWIyLThlMDEtYzUwZDgzODE1NmE2XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_QL75_UX380_CR0,9,380,562_.jpg','https://www.youtube.com/watch?v=KR7loA_oziY&pp=ygUddG8ga2lsbCBhIG1vY2tpbmdiaXJkIHRyYWlsZXI%3D','2024-09-05 21:30:00',NULL),(53,'Die Hard',132,'1988-07-20 00:00:00','English','New York City policeman John McClane (Bruce Willis) is visiting his estranged wife (Bonnie Bedelia) and two daughters on Christmas Eve. He joins her at a holiday party in the headquarters of the Japanese-owned business she works for. But the festivities are interrupted by a group of terrorists who take over the exclusive high-rise, and everyone in it. Very soon McClane realizes that there\'s no one to save the hostages -- but him.','https://m.media-amazon.com/images/M/MV5BZjRlNDUxZjAtOGQ4OC00OTNlLTgxNmQtYTBmMDgwZmNmNjkxXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_QL75_UX380_CR0,4,380,562_.jpg','https://www.youtube.com/watch?v=jaJuwKCmJbY&pp=ygUQZGllIGhhcmQgdHJhaWxlcg%3D%3D','2024-09-05 21:30:00',NULL),(54,'1917',119,'2020-01-10 00:00:00','English','During World War I, two British soldiers -- Lance Cpl. Schofield and Lance Cpl. Blake -- receive seemingly impossible orders. In a race against time, they must cross over into enemy territory to deliver a message that could potentially save 1,600 of their fellow comrades -- including Blake\'s own brother.','https://m.media-amazon.com/images/M/MV5BYzkxZjg2NDQtMGVjMy00NWZkLTk0ZDEtZWE3NDYwYjAyMTg1XkEyXkFqcGc@._V1_QL75_UX380_CR0,20,380,562_.jpg','https://www.youtube.com/watch?v=YqNYrYUiMfg&pp=ygUMMTkxNyB0cmFpbGVy','2024-09-05 21:30:00',NULL),(55,'Hamilton',160,'2020-07-03 00:00:00','English','The real life of one of America\'s foremost founding fathers and first Secretary of the Treasury, Alexander Hamilton. Captured live on Broadway from the Richard Rodgers Theater with the original Broadway cast.','https://m.media-amazon.com/images/M/MV5BNjViNWRjYWEtZTI0NC00N2E3LTk0NGQtMjY4NTM3OGNkZjY0XkEyXkFqcGdeQXVyMjUxMTY3ODM@._V1_QL75_UX380_CR0,0,380,562_.jpg','https://www.youtube.com/watch?v=uBJfGNoZ3f0&pp=ygUQaGFtaWx0b24gdHJhaWxlcg%3D%3D','2024-09-05 21:30:00',NULL),(56,'Shutter Island',138,'2010-02-19 00:00:00','English','The implausible escape of a brilliant murderess brings U.S. Marshal Teddy Daniels (Leonardo DiCaprio) and his new partner (Mark Ruffalo) to Ashecliffe Hospital, a fortress-like insane asylum located on a remote, windswept island. The woman appears to have vanished from a locked room, and there are hints of terrible deeds committed within the hospital walls. As the investigation deepens, Teddy realizes he will have to confront his own dark fears if he hopes to make it off the island alive.','https://m.media-amazon.com/images/M/MV5BYzhiNDkyNzktNTZmYS00ZTBkLTk2MDAtM2U0YjU1MzgxZjgzXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_QL75_UX380_CR0,0,380,562_.jpg','https://www.youtube.com/watch?v=5iaYLCiq5RM&pp=ygUWc2h1dHRlciBpc2xhbmQgdHJhaWxlcg%3D%3D','2024-09-05 21:30:00',NULL),(57,'Top Gun: Maverick',130,'2022-05-27 00:00:00','English','After more than 30 years of service as one of the Navy\'s top aviators, Pete \"Maverick\" Mitchell is where he belongs, pushing the envelope as a courageous test pilot and dodging the advancement in rank that would ground him. Training a detachment of graduates for a special assignment, Maverick must confront the ghosts of his past and his deepest fears, culminating in a mission that demands the ultimate sacrifice from those who choose to fly it.','https://m.media-amazon.com/images/M/MV5BMmIwZDMyYWUtNTU0ZS00ODJhLTg2ZmEtMTk5ZmYzODcxODYxXkEyXkFqcGdeQXVyMTEyMjM2NDc2._V1_QL75_UX380_CR0,0,380,562_.jpg','https://www.youtube.com/watch?v=qSqVVswa420&pp=ygUYdG9wIGd1biBtYXZlcmljayB0cmFpbGVy','2024-09-05 21:30:00',NULL),(58,'Jurassic Park',127,'1993-06-11 00:00:00','English','In Steven Spielberg\'s massive blockbuster, paleontologists Alan Grant (Sam Neill) and Ellie Sattler (Laura Dern) and mathematician Ian Malcolm (Jeff Goldblum) are among a select group chosen to tour an island theme park populated by dinosaurs created from prehistoric DNA. While the park\'s mastermind, billionaire John Hammond (Richard Attenborough), assures everyone that the facility is safe, they find out otherwise when various ferocious predators break free and go on the hunt.','https://m.media-amazon.com/images/M/MV5BMjM2MDgxMDg0Nl5BMl5BanBnXkFtZTgwNTM2OTM5NDE@._V1_QL75_UX380_CR0,4,380,562_.jpg','https://www.youtube.com/watch?v=QWBKEmWWL38&pp=ygUVanVyYXNzaWMgcGFyayB0cmFpbGVy','2024-09-05 21:30:00',NULL),(59,'Pan\'s Labyrinth',118,'2007-01-19 00:00:00','English','It\'s 1944 and the Allies have invaded Nazi-held Europe. In Spain, a troop of soldiers are sent to a remote forest to flush out the rebels. They are led by Capitan Vidal, a murdering sadist, and with him are his new wife Carmen and her daughter from a previous marriage, 11-year-old Ofelia. Ofelia witnesses her stepfather\'s sadistic brutality and is drawn into Pan\'s Labyrinth, a magical world of mythical beings.','https://m.media-amazon.com/images/M/MV5BYzFjMThiMGItOWRlMC00MDI4LThmOGUtYTNlZGZiYWI1YjMyXkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_QL75_UX380_CR0,2,380,562_.jpg','https://www.youtube.com/watch?v=jVZRnnVSQ8k&pp=ygUWcGFuJ3MgbGFieXJpdGggdHJhaWxlcg%3D%3D','2024-09-05 21:30:00',NULL),(60,'The Thing',109,'1982-06-25 00:00:00','English','In remote Antarctica, a group of American research scientists are disturbed at their base camp by a helicopter shooting at a sled dog. When they take in the dog, it brutally attacks both human beings and canines in the camp and they discover that the beast can assume the shape of its victims. A resourceful helicopter pilot (Kurt Russell) and the camp doctor (Richard Dysart) lead the camp crew in a desperate, gory battle against the vicious creature before it picks them all off, one by one.','https://m.media-amazon.com/images/M/MV5BNGViZWZmM2EtNGYzZi00ZDAyLTk3ODMtNzIyZTBjN2Y1NmM1XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_QL75_UX380_CR0,4,380,562_.jpg','https://www.youtube.com/watch?v=5ftmr17M-a4&pp=ygURdGhlIHRoaW5nIHRyYWlsZXI%3D','2024-09-05 21:30:00',NULL),(61,'Kill Bill: Vol. 1',111,'2003-10-10 00:00:00','English','A former assassin, known simply as The Bride (Uma Thurman), wakes from a coma four years after her jealous ex-lover Bill (David Carradine) attempts to murder her on her wedding day. Fueled by an insatiable desire for revenge, she vows to get even with every person who contributed to the loss of her unborn child, her entire wedding party, and four years of her life. After devising a hit list, The Bride sets off on her quest, enduring unspeakable injury and unscrupulous enemies.','https://m.media-amazon.com/images/M/MV5BNzM3NDFhYTAtYmU5Mi00NGRmLTljYjgtMDkyODQ4MjNkMGY2XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_QL75_UX380_CR0,4,380,562_.jpg','https://www.youtube.com/watch?v=7kSuas6mRpk&pp=ygURa2lsbCBiaWxsIHRyYWlsZXI%3D','2024-09-05 21:30:00',NULL),(62,'Monty Python and the Holy Grail',91,'1975-05-25 00:00:00','English','A comedic send-up of the grim circumstances of the Middle Ages as told through the story of King Arthur and framed by a modern-day murder investigation. When the mythical king of the Britons leads his knights on a quest for the Holy Grail, they face a wide array of horrors, including a persistent Black Knight, a three-headed giant, a cadre of shrubbery-challenged knights, the perilous Castle Anthrax, a killer rabbit, a house of virgins, and a handful of rude Frenchmen.','https://m.media-amazon.com/images/M/MV5BN2IyNTE4YzUtZWU0Mi00MGIwLTgyMmQtMzQ4YzQxYWNlYWE2XkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_QL75_UX380_CR0,4,380,562_.jpg','https://www.youtube.com/watch?v=urRkGvhXc8w&pp=ygUnbW9udHkgcHl0aG9uIGFuZCB0aGUgaG9seSBncmFpbCB0cmFpbGVy','2024-09-05 21:30:00',NULL),(63,'Finding Nemo',100,'2003-05-30 00:00:00','English','Marlin (Albert Brooks), a clown fish, is overly cautious with his son, Nemo (Alexander Gould), who has a foreshortened fin. When Nemo swims too close to the surface to prove himself, he is caught by a diver, and horrified Marlin must set out to find him. A blue reef fish named Dory (Ellen DeGeneres) -- who has a really short memory -- joins Marlin and complicates the encounters with sharks, jellyfish, and a host of ocean dangers. Meanwhile, Nemo plots his escape from a dentist\'s fish tank.','https://m.media-amazon.com/images/M/MV5BMTc5NjExNTA5OV5BMl5BanBnXkFtZTYwMTQ0ODY2._V1_QL75_UX380_CR0,0,380,562_.jpg','https://www.youtube.com/watch?v=SPHfeNgogVs&pp=ygUUZmluZGluZyBuZW1vIHRyYWlsZXI%3D','2024-09-05 21:30:00',NULL),(64,'Inside Out',95,'2015-06-19 00:00:00','English','Riley (Kaitlyn Dias) is a happy, hockey-loving 11-year-old Midwestern girl, but her world turns upside-down when she and her parents move to San Francisco. Riley\'s emotions -- led by Joy (Amy Poehler) -- try to guide her through this difficult, life-changing event. However, the stress of the move brings Sadness (Phyllis Smith) to the forefront. When Joy and Sadness are inadvertently swept into the far reaches of Riley\'s mind, the only emotions left in Headquarters are Anger, Fear and Disgust.','https://m.media-amazon.com/images/M/MV5BOTgxMDQwMDk0OF5BMl5BanBnXkFtZTgwNjU5OTg2NDE@._V1_QL75_UX380_CR0,0,380,562_.jpg','https://www.youtube.com/watch?v=yRUAzGQ3nSY&pp=ygUSaW5zaWRlIG91dCB0cmFpbGVy','2024-09-05 21:30:00',NULL),(65,'Catch Me If You Can',141,'2002-12-25 00:00:00','English','Frank Abagnale, Jr. (Leonardo DiCaprio) worked as a doctor, a lawyer, and as a co-pilot for a major airline -- all before his 18th birthday. A master of deception, he was also a brilliant forger, whose skill gave him his first real claim to fame: At the age of 17, Frank Abagnale, Jr. became the most successful bank robber in the history of the U.S. FBI Agent Carl Hanratty (Tom Hanks) makes it his prime mission to capture Frank and bring him to justice, but Frank is always one step ahead of him.','https://m.media-amazon.com/images/M/MV5BMTY5MzYzNjc5NV5BMl5BanBnXkFtZTYwNTUyNTc2._V1_QL75_UX380_CR0,0,380,562_.jpg','https://www.youtube.com/watch?v=71rDQ7z4eFg&pp=ygUbY2F0Y2ggbWUgaWYgeW91IGNhbiB0cmFpbGVy','2024-09-05 21:30:00',NULL),(66,'Harry Potter and the Deathly Hallows: Part 2',130,'2011-07-15 00:00:00','English','A clash between good and evil awaits as young Harry (Daniel Radcliffe), Ron (Rupert Grint) and Hermione (Emma Watson) prepare for a final battle against Lord Voldemort (Ralph Fiennes). Harry has grown into a steely lad on a mission to rid the world of evil. The friends must search for the Horcruxes that keep the dastardly wizard immortal. Harry and Voldemort meet at Hogwarts Castle for an epic showdown where the forces of darkness may finally meet their match.','https://m.media-amazon.com/images/M/MV5BMGVmMWNiMDktYjQ0Mi00MWIxLTk0N2UtN2ZlYTdkN2IzNDNlXkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_QL75_UX380_CR0,4,380,562_.jpg','https://www.youtube.com/watch?v=mObK5XD8udk&pp=ygUzaGFycnkgcG90dGVyIGFuZCB0aGUgZGVhdGhseSBoYWxsb3dzIHBhcnQgMiB0cmFpbGVy','2024-09-05 21:30:00',NULL);
